import {useState,useEffect} from 'react';

const App=()=>{
    const[constant,setconst]=useState(0);
    useEffect(()=>{setconst(100);},[]);
    return(
        <div className="counter">
            <button onClick={()=>setconst((preval)=>preval+1)}>+</button>
            <h1>{constant}</h1>
            <button onClick={()=>setconst((preval)=>preval-1)}>-</button>
        </div>
    );
}
export default App;
